# Data preprocessing: calculate cooling load of everyday as constraint of chiller sequencing optimization
def dailyLoads(L):
    ratio = 0.9 #kwh to TR
    cop = np.array(returnDataA(0, TCOP)[3])
    load = np.array(returnDataA(0, TELE)[3])
    total = cop * load
    for ci in range(1, CN-1, 1):
        cop = np.array(returnDataA(ci, TCOP)[3])
        load = np.array(returnDataA(ci, TELE)[3])
        total = total + cop * load
    total = total * ratio
    return list(total)

