# Data preprocessing: calculate loads of initial profile
def initProfile(load):
    cops = [0, 6.16666666667, 6.16666666667, 6.22833333333, 5.26666666667, 5.88333333333, 6.06666666667, 6.65333333333, 7.17649572649, 6.56666666667, 7.76666666667]
    if load == 0:
        return cops[0]
    else:
        load10 = load * 10
        ceilL = int(np.ceil(load10))
        #print load10, ceilL
        if ceilL+1 >= len(cops):
            cop = cops[-1]
        else:
            cop = cops[ceilL] - (ceilL - load10) / 1 * (cops[ceilL+1] - cops[ceilL]) 
    return cop

