# Tool for learning model: Given prediction model clf and other parameters, output the prediction score or prediction result
#arg:
# multi = 0, train with clustered samples of the targeted chiller 
#  multi == 1, train with clustered samples of multiple chillers of the same type, using neighbors of the current instance
#  multi == 2, train with clustered samples of all chillers
# predictMode == 0, bunch prediction, with fixed predict index: L * K to L, K is also fixed in returnXy
#  predictMode == 1, one-by-one prediction, with dynamic predict index
# trainMode == 0, using default training sample
#  trainMode == 1, using specified training sample, with k selected
# outputMode == 0, output score
#  outputMode == 1, output predicted py, and load can be fixed
# load, the load of chiller as a specific feature, ranging from 0 - 1000
def clusteredLearning(clf, multi = 0, predictMode = 0, predictIndex = None, outputMode = 0, load = None, trainMode = 0, inK = None):
    #print 'start'
    if predictMode == 0:
        pX, py = returnXy(1)
    elif predictMode == 1:
        pX, py = returnXy(5, index = predictIndex)
    #print 'data prepared', pX, py ###
    
    if multi == 1: #clustering multiple chillers of the same type
        returnMode = 4
    elif multi == 0: #clustering single chiller
        returnMode = 3
    elif multi == 2: #clustering all chillers
        returnMode = 7
    
    if multi == 2: #Time estimation for CMTL
        flag = True
        
    if outputMode == 0:
        Scores = []
        for i in range(len(pX)):#
            if load != None: #with load fixed
                pX[i][TELE] = load
                
            if trainMode == 0:
                tX, ty = returnXy(returnMode, pX[i])
                #print '    Length of ty: ', len(ty) ###
            elif trainMode == 1:
                tX, ty = returnXy(returnMode, pX[i], K = inK)
                #print '    Length of ty: ', len(ty) ###
            #print 'training X = ', tX ###
            #print 'training y = ', ty ###
            
            #print 'px =', [pX[i]]
            clf.fit(tX, ty)
            
            
            if multi == 2 and flag: #Time estimation for CMTL
                start = time.clock()
            inputX = [pX[i]]
            py1 = []
            py1 = clf.predict(inputX)
            
            #print py1
            if METRIC == ER:
                Scores.append(np.abs(py1[0]-py[i])/py[i])
            elif METRIC == RMSE:
                Scores.append((py1[0]-py[i])**2)
            if multi == 2 and flag: #Time estimation for CMTL
                elapsed = (time.clock() - start)
                print("Prediction Time used:",elapsed, ' Total:', elapsed*len(pX))
                flag = False
            
            #print 'done'
            #print
        return Scores
    elif outputMode == 1:
        py = []
        for i in range(len(pX)):#
#            if load != None: #with load fixed
#                pX[i][TELE] = load
#            print 'load', load ###
#            print 'K', inK ###
#            print 'returnMode', returnMode ###
#            print 'pX[i]', pX[i] ###
            
            if trainMode == 0:
                tX, ty = returnXy(returnMode, pX[i])
                #print '    Length of ty: ', len(ty) ###
            elif trainMode == 1:
                tX, ty = returnXy(returnMode, pX[i], K = inK)
                #print '    Length of ty: ', len(ty) ###
#            print 'training X = ', tX ###
#            print 'training y = ', ty ###
#            print ###
            
            #print 'px =', [pX[i]]
            clf.fit(tX, ty)
            inputX = [pX[i]]
            
            py1 = clf.predict(inputX)
            #print py1
            py.append(py1)
            #print 'done'
            #print
            
        if predictMode == 1:#only output one value
            return py[0][0]
        else:
            return py

