# Tool for learning model: The general learning function
# input: data samples (training and testing set), output: prediction error
def learning(clf, tX, ty, pX, py):
    #print (np.array(tX)).shape, (np.array(ty)).shape ###
    #print '    Length of y: ', len(ty) ###
    clf.fit(tX, ty)
    
    py1 = []
    py1 = clf.predict(pX)
    if METRIC == ER:
        return np.abs(np.abs(py1-py)/py)
    elif METRIC == RMSE: 
        #print np.max(py1-py)
        return np.power((py1-py), 2)

